messages__text__text:
Мы, президенты Литвы, Польши, Латвии и Эстонии как соседи Беларуси, члены НАТО и ЕС, хотим, чтобы Беларусь была стабильной, демократической, независимой и процветающей страной. Поэтому мы призываем президента РБ к следующему: 

1. Деэскалация ситуации и немедленное прекращение применения силы против своего народа. Мы призываем прекратить насилие и призываем к уважению основных свобод, прав человека и гражданина, включая свободу слова, средств массовой информации, собраний и безопасность журналистов;

2. В срочном порядке освободить всех задержанных участников акций протеста, прекратить дальнейшие преследования; 

3. Немедленно начать диалог с белорусским народом. Услышать голос своих граждан и дать им возможность свободно высказываться. Основываясь на опыте наших собственных обществ, а также на личном опыте, мы призываем Вас организовать «круглый стол» по национальному примирению, состоящий из представителей власти и гражданского общества. Это стало бы подходящим шагом для начала подлинного национального диалога. Мы твердо убеждены, что диалог всегда является наилучшим путем для продвижения социального развития, обсуждения реформ и будущего вашей страны.

Если белорусские власти выполнят эти требования, то двери для сотрудничества с международным сообществом должны оставаться открытыми. Изоляция - это не путь к процветанию и развитию любой нации.

Мы готовы предложить свои посреднические усилия для достижения мирного решения в Беларуси и укрепления независимости и суверенитета Вашей страны

