И напоследок — ещё два тезиса из заявления Владимира Макея:

➖ «За слезы моего одиннадцатилетнего сына я готов перегрызть горло»;
➖ «Демократией здесь не пахнет. Здесь воняет погромами и расправами».

Напомним, что по данным ООН, до сих пор остается неизвестной судьба 8 беларусов, задержанных во время мирных протестов.

МВД считает иначе:

❗️1 официально объявлен в розыск как пропавший без вести;
❗️2 человека не идентифицированы;
❗️по 2 поданы заявления в ОВД о розыске, проводится проверка;
❗️1 разыскивается по линии других служб МВД.
❗️еще по 1 проводится проверка.

⚡️Забастовки угрожают стране куда меньше, чем нам пытаются доказать;
⚡️Хорошо себя будет чувствовать разве что бизнес, который продает хлеб и молоко. Может, еще и колбасы;
